import Slideshow from '../Slideshow'

const MySlideshow = (images) => (

    <Slideshow>
        const images = [images]
        {images.map((image, index) => (
            <div
                key={index}
                className="demo-item"
                style={{ backgroundImage: 'url(' + image.src + ')' }}
            />
        ))}
    </Slideshow>
);
